import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Home from './Home';
import './App.css';
import FavShows from './FavShows';



const App = () => {
  return (
    <Router>
      <Navigation />
      <div className="App">
        <Routes>
          <Route exact path="/" Component={Home} />
          <Route exact path="./FavShows/*" Component={FavShows} />
          {/* <Route exact path='/' Component={Home} /> */}
          {/* <Route exact path='/' Component={Home} /> */}
        </Routes>

      </div>


    </Router>

  );
}

export default App;
